import React, { useEffect, useState } from "react";
import { Doughnut, Bar } from "react-chartjs-2";
import "./App.css"; // Or your custom CSS


export default function AnalyticsPage() {
  const [analytics, setAnalytics] = useState({ slots: [], summary: { statusCounts: {} } });

  useEffect(() => {
    fetch("http://localhost:4000/api/analytics")
      .then((res) => res.json())
      .then(setAnalytics);
  }, []);

  const { slots, summary } = analytics;
  const statusCounts = summary.statusCounts || {};

  // Doughnut Data: Slot Status Breakdown
  const doughnutData = {
    labels: ["Available", "Reserved", "Out of Order"],
    datasets: [
      {
        data: [
          statusCounts.available || 0,
          statusCounts.reserved || 0,
          statusCounts.out_of_order || 0,
        ],
        backgroundColor: ["#43a047", "#e53935", "#757575"],
        borderWidth: 2,
      }
    ]
  };

  // Bar Chart Data: Bookings and Revenue per Slot
  const sortedSlots = [...slots].sort((a, b) => b.totalRevenue - a.totalRevenue);
  const barChartData = {
    labels: sortedSlots.map(slot => `Slot ${slot.id}`),
    datasets: [
      {
        label: "Bookings",
        data: sortedSlots.map(slot => slot.totalBookings),
        backgroundColor: "#1976d2",
        borderRadius: 6,
        maxBarThickness: 24,
      },
      {
        label: "Revenue (€)",
        data: sortedSlots.map(slot => slot.totalRevenue),
        backgroundColor: "#ff9800",
        borderRadius: 6,
        maxBarThickness: 24,
      }
    ]
  };

  const chartOptions = {
    plugins: {
      legend: { position: "bottom" },
      title: { display: false }
    },
    responsive: true,
    maintainAspectRatio: false,
    scales: {
      x: { stacked: true, grid: { display: false } },
      y: { beginAtZero: true, grid: { color: "#ccc" } }
    }
  };

  return (
    <div className="analytics-page">
      <div className="analytics-summary">
        <h2>Analytics Overview</h2>
        <div className="summary-cards">
          <div className="summary-card">
            <span>Total Slots</span>
            <strong>{summary.totalSlots}</strong>
          </div>
          <div className="summary-card">
            <span>Total Bookings</span>
            <strong>{summary.totalBookings}</strong>
          </div>
          <div className="summary-card">
            <span>Total Revenue</span>
            <strong>€{summary.totalRevenue || 0}</strong>
          </div>
        </div>
      </div>

      <div className="charts-section">
        <div className="chart-card">
          <h3>Slot Status</h3>
          <Doughnut data={doughnutData} options={{ plugins: { legend: { position: "bottom" } } }} />
        </div>
        <div className="chart-card">
          <h3>Performance by Slot</h3>
          <Bar data={barChartData} options={chartOptions} height={300} />
        </div>
      </div>

      <div className="leaderboard-section">
        <h3>Slot Leaderboard</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Rank</th>
              <th>Slot ID</th>
              <th>Status</th>
              <th>Bookings</th>
              <th>Revenue (€)</th>
            </tr>
          </thead>
          <tbody>
            {sortedSlots.map((slot, i) => (
              <tr key={slot.id}>
                <td>{i + 1}</td>
                <td>{slot.id}</td>
                <td>
                  <span className={`status-badge status-${slot.status}`}>{slot.status.replaceAll("_", " ")}</span>
                </td>
                <td>{slot.totalBookings}</td>
                <td>€{slot.totalRevenue}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
